import './App.css';
import React, { useState } from 'react';
import PlayerStats from './PlayerStats';

/*function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>League of Legends Player Stats</h1>
        <PlayerStats />
      </header>
    </div>
  );
}*/
const championNames = [
  'Ahri', 'Akali', 'Akshan', 'Alistar', 'Amumu', 'Anivia', 'Annie', 'Aphelios', 'Ashe', 'Aurelion Sol',
  'Azir', 'Bard', 'Blitzcrank', 'Brand', 'Braum', 'Briar', 'Caitlyn', 'Camille', 'Cassiopeia', 'Cho\'Gath',
  'Corki', 'Darius', 'Diana', 'Dr. Mundo', 'Draven', 'Ekko', 'Elise', 'Evelynn', 'Ezreal', 'Fiddlesticks',
  'Fiora', 'Fizz', 'Galio', 'Gangplank', 'Garen', 'Gnar', 'Gragas', 'Graves', 'Gwen', 'Hecarim', 'Heimerdinger',
  'Illaoi', 'Irelia', 'Ivern', 'Janna', 'Jarvan IV', 'Jax', 'Jayce', 'Jhin', 'Jinx', 'Kai\'Sa',
  'Kalista', 'Karma', 'Karthus', 'Kassadin', 'Katarina', 'Kayle', 'Kayn', 'Kennen', 'Kha\'Zix', 'Kindred',
  'Kled', 'Kog\'Maw', 'LeBlanc', 'Lee Sin', 'Leona', 'Lillia', 'Lissandra', 'Lucian', 'Lulu', 'Lux',
  'Malphite', 'Malzahar', 'Maokai', 'Master Yi', 'Miss Fortune', 'Mordekaiser', 'Morgana', 'Nami', 'Nasus', 'Nautilus',
  'Neeko', 'Nidalee', 'Nocturne', 'Nunu & Willump', 'Olaf', 'Orianna', 'Ornn', 'Pantheon', 'Poppy', 'Pyke',
  'Qiyana', 'Quinn', 'Rakan', 'Rammus', 'Rek\'Sai', 'Rell', 'Renekton', 'Rengar', 'Riven', 'Rumble',
  'Ryze', 'Samira', 'Sejuani', 'Senna', 'Seraphine', 'Sett', 'Shaco', 'Shen', 'Shyvana', 'Singed',
  'Sion', 'Sivir', 'Skarner', 'Sona', 'Soraka', 'Swain', 'Sylas', 'Syndra', 'Tahm Kench', 'Taliyah',
  'Talon', 'Taric', 'Teemo', 'Thresh', 'Tristana', 'Trundle', 'Tryndamere', 'Twisted Fate', 'Twitch', 'Udyr',
  'Urgot', 'Varus', 'Vayne', 'Veigar', 'Vel\'Koz', 'Vi', 'Viego', 'Viktor', 'Vladimir', 'Volibear',
  'Warwick', 'Wukong', 'Xayah', 'Xerath', 'Xin Zhao', 'Yasuo', 'Yone', 'Yorick', 'Yuumi', 'Zac',
  'Zed', 'Ziggs', 'Zilean', 'Zoe', 'Zyra'
];

function App() {
  const [summonerName, setSummonerName] = useState('');
  const [tagline, setTagline] = useState('');
  const [region, setRegion] = useState('');
  const [championName, setChampionName] = useState('');

  const handleSummonerNameChange = (event) => {
    setSummonerName(event.target.value);
  };

  const handleTaglineChange = (event) => {
    setTagline(event.target.value);
  };

  const handleRegionChange = (event) => {
    setRegion(event.target.value);
  };

  const handleChampionNameChange = (event) => {
    setChampionName(event.target.value);
  };

  const handleSubmit = () => {
    console.log(`Summoner Name: ${summonerName}, Tagline: ${tagline}, Region: ${region}, Champion Name: ${championName}`);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>League of Legends Player Stats</h1>
        <div className="input-container">
          <label>Summoner Name:</label>
          <input
            type="text"
            value={summonerName}
            onChange={handleSummonerNameChange}
            placeholder="Enter Name"
            className="main-input"
          />
        </div>
        <div className="input-container">
          <label>Tagline:</label>
          <input
            type="text"
            value={tagline}
            onChange={handleTaglineChange}
            placeholder="Enter Tagline"
            className="main-input" 
          />
        </div>
        <div className="input-container">
          <label>Region:</label>
          <input
            type="text"
            value={region}
            onChange={handleRegionChange}
            placeholder="Enter Region"
            className="main-input" 
          />
        </div>
        <div className="input-container">
          <label>Champion:</label>
          <input
            type="text"
            value={championName}
            onChange={handleChampionNameChange}
            placeholder="Enter Champion Name"
            className="main-input" 
          />
        </div>
        <button onClick={handleSubmit}>Submit</button>
      </header>
    </div>
  );
}

export default App;
